import React from 'react';
import Logo from '../data/logo.png';


const SimplePage = () => {
  return (
    <section className='bg-black-100  p-10'>
      <div className='container border border-black mx-auto fl'>
        <img src={Logo} alt='logo' />
        <ul className="flex">
        <li className="text-black mr-4">Item 1</li>
        <li className="text-black mr-4">Item 2</li>
        <li className="text-black mr-4">Item 3</li>
        <li className="text-black mr-4">Item 4</li>
        <li className="text-black">Item 5</li>
      </ul>
      </div>
    </section>
  );
};

export default SimplePage;
